var b="url",c="添加_修改支付能力.html",d="generationDate",e=new Date(1730217901844),f="defaultAdaptiveView",g="name",h="",i="cursor",j=1,k="size",l="width",m=1211,n="height",o=0,p="adaptiveViews",q="sketchKeys",r="s0",s="variables",t="OnLoadVariable",u="page",v="packageId",w="fc8bc3e1899a4a988ccf88e159cf358a",x="type",y="Axure:Page",z="添加/修改支付能力",A="notes",B="annotations",C="fn",D="1",E="ownerId",F="9b6c47c03f89463bb05dcba41e73cb3d",G="label",H="Note",I="<p><span>点击修改之后，将相关字段反显在下方列表区域，只允许修改：通道费、状态，保存后刷新当前页。</span></p>",J="2",K="213a6fdff7024ccfb9f45ea0527c7983",L="<p><span>一旦当前配置设为“启用”，则系统自动将“商户+应用+产品”对应的其他策略设为“停用”。</span></p>",M="3",N="7dc0c54fbf52431ba7a002acb4cf72f4",O="应用归属业务线",P="<p><span>只可展示当前管理员所绑定的业务线</span></p>",Q="4",R="e0bb509bdf5a4a3ba612ce2ae219e93e",S="(Droplist)",T="<p><span>1）根据当前管理员所属产品线所对应的业务线来展示其下拉选项。</span></p><p><span>2）对于产品线busyType=00的，则需要展示所有业务线。</span></p>",U="5",V="52c175a8f5c34746a70a372b6d7fb660",W="<p><span>如果商户+应用查询不到记录，则代表本次新增是要为其分配对应的内部商户号的，同时绑定本次所选的支付平台商户号+应用ID</span></p>",X="6",Y="6c23d24ccb704fb985bb773426e70a11",Z="<p><span>扣费类型，需要根据上方的“目标商户”选择之后，查询概述商户当前已有的密钥配置对应的扣费类型后再展示对应的选项。</span></p>",ba="7",bb="bf94b2c1a589433ea795932b11d7ab19",bc="目标应用",bd="<p><span>特例说明：00产品线代表互联网所有产品线，该产品线管理员可以选择所有业务线的应用。</span></p>",be="8",bf="ee42d08b910e43dbb7586bccfe611db0",bg="绑定产品线",bh="<p><span>1）若busiType=00（互联网所有产品），则必须显性化的声明当前商户所属的产品线。选择列表范围是当前除去“00”以外的所有产品线</span></p><p><span>2）若busiType≠00，直接反显该商户对应的产品线名称即可，不可更改</span></p>",bi="style",bj="baseStyle",bk="627587b6038d43cca051c114ac41ad32",bl="pageAlignment",bm="near",bn="fill",bo="fillType",bp="solid",bq="color",br=0xFFF2F2F2,bs="image",bt="imageAlignment",bu="horizontal",bv="vertical",bw="imageRepeat",bx="auto",by="favicon",bz="sketchFactor",bA="0",bB="colorStyle",bC="appliedColor",bD="fontName",bE="Applied Font",bF="borderWidth",bG="borderVisibility",bH="top right bottom left",bI="borderFill",bJ=0xFF797979,bK="cornerRadius",bL="cornerVisibility",bM="outerShadow",bN="on",bO=false,bP="offsetX",bQ=5,bR